  @EventHandler
  public void onBlockPistonExtend(BlockPistonExtendEvent e)
  {
    if (e.isCancelled()) {
      return;
    }
    for (Block b : e.getBlocks()) {
      if (b.getType().equals(Material.SLIME_BLOCK))
      {
        e.setCancelled(true);
        return;
      }
    }
  }
}
